import React from 'react';
import { Segment, Header, Container } from 'semantic-ui-react'
import Axios from 'axios';

class HeaderComp extends React.Component {
    constructor(props) {
        super(props);
    }

    componentDidMount() {
        console.log("header");
        Axios.get('http://api.openweathermap.org/data/2.5/forecast?id=524901&APPID=0b7c22d0542de7530dbbdb593b2b5396').then(({ data }) => {
            console.log("data ", data)
    })          
    }

    render() {
        const { children } = this.props;
        return (
            <Container>
            <Segment inverted>
                <Header textAlign="center">
                    Weather
                </Header>
            </Segment>
                {children}
            </Container>
        );
    }
}

export default HeaderComp;
